svg.script:


var targetText; 
function changeToText(z) { 
		targetText = svgDocument.getElementById(z).firstChild; 
		targetText.nodeValue="link to "+z; 
} 
function changeBackText(z) { 
		targetText = svgDocument.getElementById(z).firstChild; 
		targetText.nodeValue=z; 
} 
function changeToText2(z,n) { 
		targetText = svgDocument.getElementById(z).firstChild; 
		if (n<=1) { 
			targetText.nodeValue="link to " + n + " protein record"; 
		} else { 
			targetText.nodeValue="link to " + n + " protein records"; 
		} 
} 
function changeBackText2(z,n) { 
		targetText = svgDocument.getElementById(z).firstChild; 
		targetText.nodeValue="(" + n + ")"; 
} 
